import  React from "react"; 
import FrontView from "./FRONTPAGE/FrontView";
import SecondFrontPage from "./SECONPAGE/SecondFrontPage";
import Footer from "./FOOTER/Footer";
import "./App.css"
import { BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";
const App=()=>{
    return(
    <Router>
        <div className="Head">
          <Switch>
              <Route  path="">
                <FrontView/>
              </Route>
                <SecondFrontPage/>
                <Footer/>
          </Switch>
        </div>
     </Router>
    )
}
 export default App;
